import { Component } from "react";

class EventPractice extends Component {
    state = {
        message: '메세지'
    }
    render() {
        return (
            <div>
                <h1>이벤트 연습</h1>
                <input
                    type="text"
                    name="message"
                    placeholder="아무거나 입력해 보세요"
                    value={this.state.message}
                    onChange={
                        (e)=> {
                            this.setState({message: e.target.value});
                        }
                    }
                >
                </input>
            </div>
        )
    }
}

export default EventPractice;
